import React from 'react';
import { Grid } from 'semantic-ui-react';
import MovieInfo from '../HeaderSegement/Explore/MovieInfo';



const HeaderPart = () => {
    return (
        <React.Fragment>
            <Grid columns="equal" inverted>
                <Grid.Row textAlign='right'>
                    <Grid.Column>
                        11
                    </Grid.Column>
                    <Grid.Column>
                        <MovieInfo url="https://www.youtube.com/watch?v=3PK2tIyENVA&t=2s" />
                    </Grid.Column>
                </Grid.Row>
            </Grid>
        </React.Fragment>
    )
}

export default HeaderPart;
